import React, { useState } from 'react';

import ButtonGroup from 'react-bootstrap/ButtonGroup';
import Button from 'react-bootstrap/Button';
import ToggleButton from 'react-bootstrap/ToggleButton';
import ToggleButtonGroup from 'react-bootstrap/ToggleButtonGroup';

function MenuEditAdmin() {


    const [checked, setChecked] = useState(false);
    const [radioValue, setRadioValue] = useState('1');


    const radios = [
        { name: 'Active', value: '1' },
        { name: 'Radio', value: '2' },
        { name: 'Radio', value: '3' },
    ];

    return (
        <>
            {/* <ButtonGroup className="buttonNavigation" aria-label="Basic example">
                <Button variant="secondary">Left</Button>
                <Button variant="secondary">Middle</Button>
                <Button variant="secondary">Right</Button>
            </ButtonGroup> */}
            <ToggleButtonGroup type="radio" name="options" defaultValue={1}>
                <ToggleButton id="tbg-radio-1" value={1}>
                    Radio 1 (pre-checked)
                </ToggleButton>
                <ToggleButton id="tbg-radio-2" value={2}>
                    Radio 2
                </ToggleButton>
                <ToggleButton id="tbg-radio-3" value={3}>
                    Radio 3
                </ToggleButton>
            </ToggleButtonGroup>
            {/* <div className='buttonNavigation'>
                    <button className='buttonNavigation__button'>Main</button>
                    <button className='buttonNavigation__button'>Deserts</button>
                    <button className='buttonNavigation__button'></button>
                </div> */}

            <div>
                <img src="" alt="Pancakes" />
                <h4>Pancakes</h4>
                <p>Double glazed with butter, mega packed with juicy jam
                    with a monster load of whipping cream. 4 of these in 1 serving!
                </p>
                <input type='number'></input>
            </div>
        </>
    );

}


export default MenuEditAdmin;
